/**
 * Generic Error Handler / Classifier
 *
 * Calls the appropriate custom response for a given error,
 * out of the bundled response modules:
 * badRequest, forbidden, notFound, & serverError
 *
 * Defaults to `res.serverError`
 *
 * Usage:
 * ```javascript
 * if (err) return res.negotiate(err);
 * ```
 *
 * @param {*} error(s)
 *
 */

module.exports = function (err) {

  // Get access to response object (`res`)
  var res = this.res;

  var statusCode = 500;
  var body = err;

  var Path = require('path');

  try {

    statusCode = err.status || 500;

    // Set the status
    // (should be taken care of by res.* methods, but this sets a default just in case)
    res.status(statusCode);

  } catch (e) {}

  // Respond using the appropriate custom response
  if (statusCode === 403) return res.forbidden(body);
  if (statusCode === 404) return res.notFound(body);
  if (statusCode === 400 && (err.code == "E_MACHINE_RUNTIME_VALIDATION" || err.code == "E_INVALID_TYPE") && !this.req.wantsJSON) {
    require('fs').open(Path.resolve(process.cwd(), "views", "validationError.ejs"), 'r', function(e) {
      if (e) {
        return res.send(makeValidationErrorPage(err));
      }
      return res.view("validationError", err);
    });
  }
  else if (statusCode >= 400 && statusCode < 500) return res.badRequest(body);
  else return res.serverError(body);
};

function makeValidationErrorPage (data) {
  var html = "" +
  "<html>" +
  " <head>" +
  "   <link href='http://sailsjs.org/styles/fonts.css' rel='stylesheet'/>" +
  "   <style>" +
  "     body {background: -moz-radial-gradient(center,ellipse cover,#c89a70 0,#c89a70 15%,#157e99 100%);background: -webkit-gradient(radial,center bottom,0,center bottom,100%,color-stop(0%,#c89a70),color-stop(15%,#c89a70),color-stop(100%,#157e99)); background: -webkit-radial-gradient(center,ellipse cover,#c89a70 0,#c89a70 15%,#157e99 100%); background: -o-radial-gradient(center,ellipse cover,#c89a70 0,#c89a70 15%,#157e99 100%); background: -ms-radial-gradient(center,ellipse cover,#c89a70 0,#c89a70 15%,#157e99 100%); background: radial-gradient(ellipse at center bottom,#c89a70 0,#c89a70 15%,#157e99 100%); filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#c89a70', endColorstr='#157e99', GradientType=1); -moz-box-sizing: border-box; -webkit-box-sizing: border-box; box-sizing: border-box; height: 100%; width: 100%; position: absolute; top: 0;}" +
  "     .content {margin-top: 50px; text-align: center; color: white; font-family: \"Open Sans\",\"Myriad Pro\"; font-size: 18px} " +
  "     .bear {background-position: center 10px; background-repeat: no-repeat; background-size: 40%; opacity: .25; position: absolute; width: 100%; height: 100%; top: 0; left: 0; background-image: url(data:image/png;base64,)}" +
  "     h1 {font-size: 36px; font-weight: bold} " +
  "     ul {display: inline-block; position: relative; left: -10px} " +
  "     li {list-style: none;} " +
  "    .header-scene {padding: 150px 0 350px; color: #fff; } " +
  "    .content-section {left: -8px; background-color: #212222; z-index: 50; padding: 0 0 400px; color: #fff; position: relative;}" +
  "    .circle-outer {-webkit-transition: all 250ms; -moz-transition: all 250ms; -ms-transition: all 250ms; -o-transition: all 250ms; -moz-box-sizing: border-box; -webkit-box-sizing: border-box; box-sizing: border-box; position: absolute; z-index: 70; width: 120%; border-top-left-radius: 50%; border-top-right-radius: 50%; height: 125px; background-color: inherit; top: -125px; left: -10%;}" +
  "    .logo {width: 150px; height: 54px; margin: 0 auto 0 auto}" +
  "    .logo img {width: 150px; height: 54px;}" +
  "    .errors {padding: 5px; background: rgba(255,255,255,.1); margin: 0 auto 0 auto; border-radius: 8px; width: 80%}" +
  "   </style>" +
  " </head>" +
  " <body>" +
  "   <div class=\"bear\"></div>" +
  "   <div class=\"header-scene\"></div>" +
  "   <div class=\"content-section\">" +
  "     <div class=\"circle-outer\">" +
  "     <div class=\"content\">" +
  "       <h1>Uh oh, bear trap!</h1>" +
  (data.errors.length > 1 ?
  "      <p>There were some problems with your request:</p>" :
  "      <p>There was a problem with your request:</p>"
  ) +
  "      <div class=\"errors\">" +
  "         <ul>";
  _.each(data.errors, function(error) {
    switch (error.code) {
      case "E_INPUT_REQUIRED":
        html += "<li>&ldquo;" + error.input + "&rdquo; is required, but wasn&rsquo;t sent.</li>";
        break;
      case "E_INVALID_TYPE":
        html += "<li>"+error.errors[0].message+"</li>";
        break;
      default:
        break;
    }
  });
  html += "" +
  "         </ul>" +
  "      </div>" +
  "    </div>" +
  "    <div class=\"logo\"><img src=\"data: image/png;base64,\"/></div>" +
  "  </div>" +
  " </body>" +
  "</html>" +
  "";
  return html;
}
